import React from "react";
import "./Footer.css";
import "./HorizontalneListe.css";
import HorizontalnaLista from "./HorizontalneListe";
import Ikona from "./Ikonica.js";
import "./Ikonica.css";
function Footer(){
    return(
        <div>
            <Ikona url="/slike/10-kitty-litter-leded.w700.h700.jpg"/>
            <footer>
                <div id="tekst">
                    <HorizontalnaLista prvi="ABOUT" drugi="TEAM" treci="CONTACT"/>
                </div>
            </footer>
        </div>
    );
}

export default Footer;
